    <div class="collapse navbar-collapse background-c align-items-center" id="collapsingNavbar">
      <ul class="navbar-nav">

        <li class="nav-item">
          <a class="nav-link" href="#about-me">About</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#skills">Skills</a>
        </li>
        <li class="nav-item">
